const lz=(n,e)=>(+n+Math.pow(10,e)+'').substr(1)
const rb=()=>Math.random()<0.5
const rm=m=>~~(Math.random()*m)
const rr=(n,x)=>Math.round(Math.random()*(x-n))+n
const rn=(n,x)=>{let r=Math.random();return !x?(!n?r<0.5:~~(r*n)):Math.round((r*(x-n))+n)}
const nc=n=>(n+'').replace(/\B(?=(?=\d*\.)(\d{3})+(?!\d))/g,',')
const mc=(n,d=2)=>('$'+n.toFixed(d)).replace(/\B(?=(?=\d*\.)(\d{3})+(?!\d))/g,',');
const ro=a=>{let b=a.slice(0),c=[];while(b.length){c.push(b.splice(Math.floor(Math.random()*b.length),1)[0])}return c}
const fy=a=>{for(let b=a.slice(0),i=0,l=b.length,j,t;i<l;i++){j=~~(Math.random()*(l-i))+i;t=b[i];b[i]=b[j];b[j]=t}return b}
const as=a=>a.slice().sort(function(){return Math.random()-.5})
const td=()=>{if(!td.t)td.t=new Date();else{td.r=new Date()-td.t;td.t=0;return td.r}}
const ni=n=>[].indexOf.call(n.parentNode.children, n);
const tm=(t,d)=>{for(let i in d){t=t.replace(RegExp('\\<%=\\s*'+i+'\\s*%>','g'),d[i]);}return t;}
const ra=(r,s,c)=>{for(let i in r)c=c.replace(r[i],s[i]);return c}